import React from 'react';
import '../../css/tweets/TwitterAccountForm.css';

class TwitterAccountForm extends React.Component {
    constructor(props) {
        super(props);

        this.options = props.twitterAccounts.map(account => <option value={account}> {account} </option>);

    }


    render() {

        return (
            <div className="TwitterAccount">
                <h3>Twitter:</h3>
                <select id="TwitterAccount" name="twitterAccount">
                    this.options
                </select>
            </div>
            );
    }
}

export default TwitterAccountForm;
